import { ClassNames } from "@emotion/react";
import React, { Fragment,useState,useEffect } from "react";
import Table from 'react-bootstrap/Table';

const StudentCurd = () => {
  const[data,setdata]=useState();
  console.log("set data:",data);
  
  const rows = [
    {
      Id: 1,
      Name: "Swara",
      age: 23,
      Address: "pune",
      Class: "second",
      SkillId: 1,
    },
    {
      Id: 2,
      Name: "Sunita",
      age: 23,
      Address: "pune",
      Class: "second",
      SkillId: 4,
    }
    ,  {
      Id: 3,
      Name: "Mira",
      age: 23,
      Address: "pune",
      Class: "second",
      SkillId: 5,
    }
  ];
  
  
  useEffect(()=>{
    setdata(rows);
      },[])
  return (
    <Fragment>
     <Table striped bordered hover>
      <thead>
        <tr>
          <th>#</th>
          <th>Name</th>
          <th>Age</th>
          <th>Address</th>
          <th>Class</th>
          <th>SkillId</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>{

        rows&&rows.length>0?
        rows.map((item,index)=>{
          return(
            <>
<tr key={index}>
<td>{index+1}</td>
          <td>{item.Name}</td>
          <td>{item.age}</td>
          <td>{item.Address}</td>
          <td>{item.Class}</td>
          <td>{item.SkillId}</td>
          <td colSpan={2}>
            <button className="btn btn-primary">Edit</button>&nbps;
            <button className="btn btn-danger">Delete</button>

          </td>
        </tr>
        
        </>
        )
        })
       :
       '...Loading'
        }
      </tbody>
    </Table>
    </Fragment>
  );
};

export default StudentCurd;
